import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import { IconButton } from "@material-ui/core";

export default function Navbar() {
    const useStyles = makeStyles({
        root: {
          background: "linear-gradient(to left, #333399 0%, #0099cc 100%)",
          width: "250px",
          position: "fixed",
        },
        IconColor: {
          color: "#FFFFFF",
        },
        dividerColor: {
          background: "#FFFFFF",
          marginLeft: "40px",
          marginRight: "40px",
          height: "1px",
        },
        backArrowClass: {
          marginLeft: "-45px",
        },

        headingStyle: {
          marginTop: "8px",
          marginLeft: "0.2%",
        },

        toolBarHeight: {
          height: "64px",
        },
      });

  return (
    <Fragment>
      <nav
        className="navbar navbar-expand-md bg-primary navbar-dark fixed-top"
        style={{
          background: "linear-gradient(to left, #333399 0%, #0099c 100%)",
        }}
      >
        <IconButton
          classes={{ paper: classes.IconColor }}
          onClick={handleDrawer}
          edge="start"
          aria-label="menu"
        >
          <span className="navbar-toggler-icon"></span>
        </IconButton>
        <a href="/" className="navbar-bound">
          Arthy Umapathy
        </a>
      </nav>
    </Fragment>
  );
}
